import React, { useState } from "react";
import reactDom from "react-dom";
import Modal from "react-bootstrap/Modal";
import prevButton from "./assets/button-prev.png";
import nextButton from "./assets/button-next.png";
import Button from "react-bootstrap/Button";
import content01 from "./assets/image-content-01.jpg";
import content02 from "./assets/image-content-02.jpg";
import content03 from "./assets/image-content-03.jpg";
import content04 from "./assets/image-content-04.jpg";
import content05 from "./assets/image-content-05.jpg";
import content06 from "./assets/image-content-06.jpg";
import content07 from "./assets/image-content-07.jpg";
import content08 from "./assets/image-content-08.jpg";
import content09 from "./assets/image-content-09.jpg";

const modals = [
  { id: "001", img: content01 },
  { id: "002", img: content02 },
  { id: "003", img: content03 },
  { id: "004", img: content04 },
  { id: "005", img: content05 },
  { id: "006", img: content06 },
  { id: "007", img: content07 },
  { id: "008", img: content08 },
  { id: "009", img: content09 },
];

export default function CustomModal(props) {
  const { id, handleNextClick, handlePrevClick } = props;
  const [modalShow, setModalShow] = useState(null);

  return (
    <Modal
      dialogClassName="custom-dialog"
      {...props}
      size="md"
      aria-labelledby="contained-modal-title-vcenter"
      centered
    >
      <Modal.Header>
        <Modal.Title id="contained-modal-title-vcenter"></Modal.Title>
      </Modal.Header>

      {id !== null && (
        <Modal.Body>
          <div className="custom-body">
            <img
              src={modals[parseInt(id.replace("num", "")) - 1].img}
              alt={id}
            />
          </div>
        </Modal.Body>
      )}
      <Modal.Footer>
       { modals[parseInt(id.replace("num", "")) - 1] !== 0 && (
          <Button className="prev" onClick={() => handlePrevClick()}
           >
            <img src={prevButton} />
          </Button>)
}  
        <Button className="next" onClick={() => handleNextClick()}>
          <img src={nextButton} />
        </Button>
      </Modal.Footer>
    </Modal>
  );
}
